import React, { useContext } from 'react';
import { NavLink } from 'react-router-dom';
import './NavBar.css';

const NavBar = (props) => {
  const auth = useContext(AuthContext);
  return (
    <ul className="nav-links">
      <li>
        <NavLink to="/" exact>
          HOME
        </NavLink>
      </li>
      {auth.isLoggedIn && (
        <li>
          <NavLink to="/account">ACCOUNT</NavLink>
        </li>
      )}
    </ul>
  );
};

export default NavBar;
